import React, { Component } from "react";
import ReactDOM from "react-dom";

class Search extends Component {
  state = {};
  constructor(props) {
    super(props);
    this.state = { classname: "" };
    this.state = { sname: "" };
  }
  mySubmitHandler = event => {
    event.preventDefault();
    alert("You are submitting " + this.state.classname);
    alert("You are submitting " + this.state.sname);
  };
  myClassHandler = event => {
    this.setState({ classname: event.target.value });
  };
  mySHandler = event => {
    this.setState({ sname: event.target.value });
  };
  render() {
    return (
      <React.Fragment>
        <form id="form" onSubmit={this.mySubmitHandler}>
          <p>
            <i>
              {" "}
              <input
                type="text"
                className="input"
                placeholder="Class"
                id="classInput"
              />
            </i>
            <i>
              <input
                type="text"
                className="input"
                placeholder="Search..."
                id="searchInput"
                onChange={this.mySHandler}
              />{" "}
            </i>
          </p>
          <input type="submit" onclick="cname();" />
        </form>
      </React.Fragment>
    );
  }
}

export default Search;

function cname() {
  var cinput = document.getElementById("classInput").value;
  alert("dscdscdscdscs");
}

function sname() {
  var sinput = document.getElementById("searchInput").value;
  alert(sinput);
}
